import '../App.css';

export default class Sidebar extends React.Component{
    render(){
        return(
            <div className="sidebarContainer">
                <div>
                    <img className="avatar-profile" src={require('../assets/Bgs/av_st.png')} alt="avatar"/>
                    <h5 className="name">Benantar Abdenour</h5>
                </div>
            </div>
        );
    };
}
